const initialState = {
  isAuthenticated: false,
  user: {},
  cockpitData: {
    data: [],
    loader: false,
  },
};

export default function (state = initialState, action) {
  switch (action.type) {
    case 'GET_SKU_COCKPIT':
      // return action.payload
      return {
        ...state,
        cockpitData: action.payload || [],
      };
    default:
      return state;
  }
}
